import React from "react";
import Food from "./Food";

const LastestFood = ({foods}) => {    
    const foodsItems = foods.map((food, index) => {
        return <Food random={food} key = {index}/>    // this 
    })



    return (
        <div>
            <ul>
                {foodsItems}
            </ul>
        </div>
    )
}


export default LastestFood;
